import React from 'react'
import '../App.css';
import CARD from './CARD';
import {useState} from 'react'

function GETCARDS({ props }) {

    
    const [states, setStates] = useState(props.state.suggestion)
    const filterItem = id => {
        setStates(prevState => prevState.filter(el => el.id !== id))
     } 

    return (
        <div className="cards">
            <CARD  state= {states && states.req.length > 0 ? states:null } filterItem = {filterItem}/>
        </div>
    )


    
}
export default GETCARDS;
